<?php
add_action( 'wp_footer', 'whatsapp_icon' );
 
function whatsapp_icon() {
?>
<script type="text/javascript">
    document.addEventListener("DOMContentLoaded", function() {
        insertWA ();

        window.addEventListener('resize', insertWA);
        
    });

    function insertWA () {
        if ( window.innerWidth > 992 ) {
            var wa = document.querySelector('.lqva_wp_icon_wrapper');
            if (wa) {
                wa.parentNode.removeChild(wa);
            }
            return true;
        }

        var urlWA = 'https://api.whatsapp.com/send?phone=5491133330764';
        var html = document.createElement('div');
        html.setAttribute('class', 'lqva_wp_icon_wrapper');
        html.style.position = 'fixed';
        html.style.zIndex = '1111111111';
        html.style.bottom = '20px';
        html.style.right = '20px';

        var inner = document.createElement('a');
        inner.setAttribute('href', urlWA);
        inner.setAttribute('target', '_blank');
        inner.setAttribute('title', 'WhatsApp');
        inner.style.backgroundImage = 'url("data:image/png;base64,")';
        inner.style.backgroundPosition = 'center';
        inner.style.backgroundSize = 'cover';
        inner.style.display = 'block';
        inner.style.width = '40px';
        inner.style.height = '40px';

        html.appendChild(inner);
        document.body.appendChild(html);
    }
</script>
<?php
}